import styled from "styled-components";

export const WarningMessage = styled.div`
  width: 100%;
  height: 100%;
  align-self: center;
  display: flex;
  flex-direction: column;
  /* justify-content: center; */
  align-items: center;
  text-transform: initial;

  h5 {
    margin-bottom: 0;
  }

  .buttons-container {
    width: 50%;
    display: flex;
    justify-content: space-around;
  }
`;
